import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";

import "./Card.css";
function Card(props) {
  return (
    <div className=" p-2 mb-2 bg-warning text-dark">
      <div className="cards">
        <div className="card">
          <img src={props.imgsrc} alt="myname" className="My_pic" />
          <div className="card_info">
            <span className="card_cart">{props.title}</span>
            <h3 className="card_title">{props.sname}</h3>
            <a href={props.slink} target="_blank">
              <button> Watch now</button>
            </a>
          </div>
        </div>
      </div>
    </div>
  );
}
export default Card;
